developper-guide/react-redux/redux/proce.body:
Reducers and actions
The reducer we used in the last section was trivial: the state  never changes. As a consequence, we were not able to process user actions. In order to build a more useful reducer, we need to have a closer look at the reducer second argument: the action.
An action is a plain JavaScript object describing what happened. For instance, the following action can be used to describe what the user did when he edited a code label:
const anAction = {
  type: 'EDIT_CODE_LABEL', //what kind of action happened
  payload: { //details about this action
    id: 'code_2', //which code are we dealing with ?
    label: 'regular happy' //the new label
  }
}

If we pass this action as a second argument to our reducer (with the state used in the last section as its first argument), we expect it to return a new state, where the label for the code with id code_2 has been replaced with "regular happy".
const previousState = {
  codeListById: {...}
  codeById: {
    ...
    code_2: {
      label: 'happy'
    }
    ...
  }
}

const newState = simpleReducer(previousState, anAction)

We expect newState to equal to:
{
  codeListById: {...}
  codeById: {
    ...
    code_2: {
      //the only change concerns the code_2 label
      label: 'regular happy'
    }
    ...
  }
}

In order to achieve this, here is a possible implementation of the reducer:
function simpleReducer(state, action) {
  if (action.type === 'EDIT_CODE_LABEL') {
    return {
      //codeListById will not be impacted by this action, since it only keeps
      //track of code ids, not code labels
      codeListById: state.codeListById,
      codeById: {
        //see notes below if the syntax bothers you
        //we keep all the codes unchanged...
        ...state.codeById,
        //...except for the code which was edited, which needs to be updated to
        //take into account the new label
        [action.payload.id]: {
          label: action.payload.label
        }
      }
    }
  }
  //we return the current state: the action is not supposed to have any effect
  //on the state
  else return state
}

A reducer should be a pure function, which means that it cannot mutate the initial state. The following implementation would not comply to this rule:
function simpleReducer(state, action){
  if (action.type === 'EDIT_CODE_LABEL') {
    state.codeById[action.payload.id].label = action.payload.label
  }
  return state
}

It returns the expected new state (with the label "regular happy" for code_2), 
but it mutated the initial state (in fact, the initial state and the next state
are the same object).
The reducer implementation uses the spread operator with objects  and computed property names to make writing immutable updates shorter.
Initial state
A reducer takes a previous state and an action, and returns a new state. At initialization, no previous state is available. A common pattern is to use ES2015 default parameters to give our state an initial value. In our example, we could use the hard coded state we worked with:
const initialState = {
  codeListById: {
    code_list_1: { ... },
    ...
  },
  codeById: {
    code_1: { ... },
    ...
  }
}

function myReducer(state=initialState, action) {
  ...
}

developper-guide/react-redux/redux/dispa.body:
Dispatch actions
In the last section, we built a reducer which given the following action, returned a new state where the label for the corresponding code had been updated:
const anAction = {
  type: 'EDIT_CODE_LABEL', //what kind of action happened
  payload: { //details about this action
    id: 'code_2', //which code are we dealing with ?
    label: 'regular happy' //the new label
  }
}

We also saw that thanks to the connect mechanism from React Redux, our application renders according to the data containing in the store.
The missing part here consists of telling to the store that an action occurred, in order to make the reducer return the new state. This what is called "dispatch an action" to the store. We don't necessarily need React Redux for this, but here again, the React Redux connect function makes things easy.
Action creator
First, let's wrap our action with a function, which given a code id and a value, will return the corresponding action:
function editCodeLabel(id, label) {
  return {
    type: 'EDIT_CODE_LABEL',
    payload: {
      id, //ES1015 shorthand for id: id
      label
    }
  }
}

Read more about the shorthand notation.
Then, our action can be created with:
const anAction = editCodeLabel('code_2', 'regular happy')

The editCodeLabel function is called an action creator.
Use connect second argument
We can then extend our previous example by giving a second argument to the connect function:

//We assume the `editCodeLabel` function above was defined in a file called
//`actions`
import { editCodeLabel } from './actions'

...

//The component will receive a new prop: a function named `editCodeLabel`. This
//function is not the `editCodeLabel` function we imported, but a new function
//provided by the connect mechanism.
function CodeListEditorDumb({ codes, editCodeLabel }) {
  return (
    ...
      {
        codes.map(({ id, label }, i) => 
          //We use `editCodeLabel` to handle changes in each code editor, (we
          //use an arrow function to give the proper id as a first argument)
           editCodeLabel(id, val)} />)    
      }
    ...
  )
}

const mapStateToProps = ...


//The connect second argument is often called `mapDispatchToProps`. In its
//simplest version, it is an object where each key represents an action
//creator (ie a function which returns an action)
const mapDispatchToProps = {
  editCodeLabel: editCodeLabel //we could use ES2015 shorthand notation
}

export default 
  connect(mapStateToProps, mapDispatchToProps)(CodeListEditorDumb)

When the editCodeLabel function is called from the CodeListEditor component (more precisely from a CodeEditor component), the returned value of the raw editCodeLabel function will be dispatched to the store. In other words, the connect mechanism wraps the action creator with a dispatch call to the store.
To help you grasp what connect did to the initial editCodeLabel function, you can consider that it replaced it with the following editCodeLabelAfterConnect function:
function editCodeLabelAfterConnect(id, value) {
  //the connect mechanism can access the store
  store.dispatch(editCodeLabel(id, value))
}

You can play with this pen. Notice that the codes are updated and the UI re-rendered.

developper-guide/react-redux/redux/reduc.body:
Reducers - Split and combine
We can now try to implement the "add a code" functionality. We need:

to add a new action creator;
to process the corresponding action within the reducer.

The action creator needs to know which code list we're adding a code to:
let lastId = 0
function addCode(codeListId) {
  return {
    type: 'ADD_CODE',
    payload: {
      codeListId,
      id: `new_code_${lastId++}`
    }
  }
}

Notice we gave an id to our code. To keep things simple, we created an incremental id, but in the real application we use a randomly generated id.
The reducer logic gets more complex: 
function simpleReducer(state, action) {
  if (action.type === 'EDIT_CODE_LABEL') {
    ...
  }
  else if (action.type === 'ADD_CODE') {
    //get the relevant code list
    const codeList = state.codeListById[payload.codeListId]
    //get the actual codes for the code list
    const codes = codeList.codes
    //add the code id at the end
    const newCodesIds = [...codeIds, payload.id]
    //update `codeListById` with the new codes
    const codeListById = {
      ...state.codeListById,
      [payload.codeListId]: {
        ...codeList,//we keep all exiting keys in the code list (here the
                    //code list label)
        codes: newCodesIds //we udpate the codes key
      }
    }
    //we update the codes by adding an entry for the new code
    const codeById = {
      ...state.codeById,
      [payload.id]: {
        label: ''
      }
    }
    //we return the new state
    return {
      codeListById,
      codeById
    }
  }
  //we return the current state: the action is not supposed to have any effect
  //on the state
  else return state
}

The code gets quickly very long: we need to process the effects on the different state's entries, without mutating the initial state (which would have made the code shorter). Thanks to the way we shape our state (one entry per kind of entity with references across entities based on ids, as opposed to a nested structure where code lists would contain code descriptions), we can easily split our main reducer into two smaller reducers, working independently one from another:

a reducer to handle the code lists;
a reducer to handle the codes.

We then combine these reducers to handle all the application logic.
import { combineReducers } from 'redux'

function codeListByIdReducer(state, action) {
  const { type, payload } = action
  if (type === 'ADD_CODE') {
    const codeList = state[payload.codeListId]
    return {
      ...state,
      [payload.codeListId]: {
        ...codeList,
        codes: [...codeList.codes, payload.id]
      }
    }
  }
  else return state
}

function codeByIdReducer(state, action) {
  const { type, payload } = action
  if (type === 'EDIT_CODE_LABEL') {
    const code = state[payload.id]
    return {
      ...state,
      [payload.id]: {
        ...code,
        label: payload.label
      }
    }
  }
  else if (action.type === 'ADD_CODE') {
    return {
      ...state,
      [payload.id]: {
        label: ''
      }
    }
  }
  else return state
}

const mainReducer = combineReducers({
  codeListById: codeListByIdReducer,
  codeById: codeByIdReducer
})

We can now update our CodeListEditor component to pass it the addCode function (the action creator wrapped into a dispatch call through the connect mechanism):
//The `addCode` action creator  needs to be passed the id of the code list
//we're adding a code to. Hence, the `addCode` function passed to the
//`CodeListEditorDumb` component (which wraps the action creator with
//a dispatch call) needs this argument too. It is available through the `id`
//prop: when we call ``, the `id` prop is
//passed to the `CodeListEditor`, and the connect mechanism will make
//this prop follow up to the `CodeListEditorDumb` component.
function CodeListEditorDumb({ id, codes, editCodeLabel, addCode }) {
  return (

       addCode(id) }>
        Add a code


      ...

  )
}

