developper-guide/javascript/syntax.html.body:
JavaScript
This file does not intend to provide an extensive presentation of all the JavaScript background needed to start coding the application, but it rather tries to give the minimal information and some external references to avoid confusing the developer who would not be familiar with some features of the language.
ES2015
We use ES2015 syntax thanks to the babel plugin for Webpack. Most of the highlights in this file are related to ES2015 syntax.
Destructuring
Destructuring assignments allow to extract some information from an object or an array. They look like this:
const person = { firstname: 'john', lastname: 'doe' }
const { firstname, lastname } = person
console.log(firstname) // 'john'
console.log(lastname) // 'doe'

This approach can be used for destructuring function arguments. We use them a lot when defining React components:
function CodeEditor(props) {
  let label = props.label
  (...)
}

can be rewritten as:
function CodeEditor({ label }) {
  return (...)
}

Destructuring assignments are also frequently used in combination with array functions:
var codes = [{ id: '...', label: '...'}, { id: '...', label: '...' }]
codes.map(function (code) {
  const id = code.id
  const label = code.label
  return ... //do something with id and label
  }
)
}

can be rewritten as:
var codes = [{ id: '...', label: '...'}, { id: '...', label: '...' }]
codes.map(({id, label}) => ) {
  return ... //do something with id and label
  }
)
}

Spread operator with arrays
It can be useful to update an array without mutating the initial one:
const initialArray = ['john', 'jack', 'bob']

//keep all except the first one
const [dontCare, ...withoutFirst] = initialArray

//add an entry
const withOneMore = [...initialArray, 'kate']

Spread operator with objects
This syntax is not part of ES2015, but might be part of future JavaScript versions. Like ES2015 syntax, it is supported thanks to babel, with the transform-object-rest-spread plugin.
It allows to make a copy of some object before updating some properties:
const initialObject = {
  id1: 'one',
  id2: 'two',
  id3: 'three'
}

//`initialObject` won't be modified
const newObject = {
  ...initialObject,
  id2: 'deux'
}
//another way to do this can be
// const newObject = Object.assign(initialObject, { id2: 'deux' })

We can also use the spread operator to keep all the entries except one (useful to remove an entry):
const initialObject = {
  john: 25,
  jack: 65,
  bob: 35
}

//we want to remove the "jack" entry
const {
  jack: dontCare,
  ...withoutJack
} = initialObject

//`withoutJack` is the new object
`

Computed property names
Usually, to create an object when a key comes from a variable, we write that kind of code:
const firstname = 'john'
const names = {}
names[firstname] = 'doe'

In ES2015, with computed property names, we can write:
const firstname = 'john'
const names = {
  [firstname]: 'doe'
}

It is particularly useful in combination with the spread operator to enforce immutability when working with objects (like in a reducer). This way, we can make a copy of an object and only update one key:
const initialObject = {
  id1: 'one',
  id2: 'two',
  id3: 'three'
}
const idToProcess = 'id2'
const newValue = 'deux'
const newObject = {
  ...initialObject,
  [idToProcess]: newValue
}

Shorthand property names
ES2015 provides a shorthand to create an object from variables when the object keys match the variables names shorter.
var firstname = 'john'
var lastname = 'doe'
//Before ES2015
var person = {
  firstname: firstname,
  lastname: lastname
}
//With ES2015
var person = {
  firstname,
  lastname
}

Arrow functions
Arrow functions are a short and convenient way to write small anonymous functions. They look like this:
const increment = a => a + 1

They are used extensively in this application, but the regular function expression function () {} is still preferred when the logic is not trivial.
Template literals
Template literals are convenient to describe strings that would be otherwise built by concatenating (+) multiple strings. For instance in src/js/utils/state-to-model-questionnaire.js:
const makePageBreakGroup = index => ({
  name: `PAGE_${index}`,
  label: `Components for page ${index}`,
  ...
})

Another advantage of template literals is that they allow to write multiline strings easily.
Export and import
This application uses export and import ES6 statements. Some useful information about them can be found here Error: file not found: /github/workspace/local_source/en/developper-guide/javascript/https:/developer.mozilla.org/en/docs/Web/JavaScript/Reference/Statements/import and there export.
Briefly, we can keep in mind that there are two kind of export(s): named exports and default exports. Both are used in this application.
Named exports follow one of these patterns:
export const firstNameExport = ...
//or
export {
  secondNamedExport,
  thirdNamedExport
}

While default exports look like this:
const mainPurposeOfThisFile = ...
export default mainPurposeOfThisFile

Imports of named exports use curly brackets to identify which exported variables should be imported.
import { firstNameExport, secondNamedExport } from '...'

while default exports are imported with:
import mainPurposeOfThisFile from '...'

When we import a default export, the name we give to the local variable does not need to match the name defined in the module. The code above could be re-written like this:
//We use `aRelevantName` in place of `mainPurposeOfThisFile`
import aRelevantName from '...'

Components
Components live in their own file, so we use export default to expose them. There might be in the same file a generic definition of the component, what is sometimes called a presentational component, and a 'connected' component. Most of the time, only the 'connected' component will have a purpose for the outside world, so the export looks like this (see src/js/components/component-editor.js):
function ComponentEditor(...) {
}
...
export default connect(mapStateToProps, mapDispatchToProps)(ComponentEditor)

Import css
This application uses style-loader in combination with Webpack. It allows to import css files from JavaScript. Hence, in src/js/main.js, we import the main css files the application will need:
require('../css/pogues.css')

It is convenient:

to mark some particular css file as a dependency for some JavaScript code to run properly;
to process the file to make performance optimizations (inline css rules in the head section of the html file) and compatibility adjustments (for instance by adding prefixes when needed);
to make Webpack taking care of copying this asset to the dist folder.

user-guide/user-release-note.html.body:
Release notes
09/04/21
Dear Pogues users,
A new version of Pogues is now available in production.
Here are the main new features:

New input conditions
It is now mandatory to declare a minimum and a maximum for any number field, whether it is collected, external or calculated. 

-Statements: 
                -until now the possible statement types were Help, Warning, Instruction and Comment. On the web or on paper, they were not really distinguished. This list has been revised in order to take into account the collection by interviewer. From now on, the modalities will be :
                            - Help (when it concerns the respondent, whatever the mode: paper, web, with interviewer) ;
                            - Instruction (when it must be seen only by the interviewer);
                            - Code-card (for questions where the interviewer will have to present a code-card to the respondent): the choice of such a deposit should lead to a particular visual (an icon a priori) on the future Queen interviewer station.
            -an attribute has also been to a statement: the collection mode. It is now important to enter the collection mode of a statement since it will soon be used to decide whether or not to display a statement on the questionnaires, which will make it possible to have statements specific to the interviewer modes (CAPI and CATI), for example, which will not be displayed on the web or on paper. 
-It is now possible to redirect the respondent to the end of the questionnaire by choosing the target QUESTIONNAIRE_END in the Target field of the Goto tab. 

New features and bug fixes
the "Modifications not validated" pop-up that warns you when you have consulted and possibly modified a tab without validating it, can now be bypassed without having to revalidate or cancel all the previously consulted tabs. Two buttons have therefore been added to the pop-up:
"Validate as is" to allow you to validate all your validated changes to the item
"Back" if you prefer to validate your last updates on the tabs before validating;

-The specifications have been enriched and contain the tooltips, filters (start, end, conditions) and loops (content, loop type) described for the questionnaire. In case of redirection, the filtered variables are also shown with the mention "filter";
-Code list : 
            -It is now possible to create a list of codes by importing a csv file, encoded in utf8, respecting the format of the following example:
Parent;Value;Label;
;code1;label1;
;code2;label2;
;code3;label3;
;code4;label4;
;code5;label5;
;code6;label6;
;code7;label7;
;code8;label8;
;code9;label9;
;code10;label10;
Parent will store the parent code when the code list is hierarchical and will therefore be empty in general
Value will store the code of each modality
Label will store the label of each modality
            -A "Duplicate Code List" button allows you, when checked, to duplicate a code list to create a variant. The title of the initial list will be suffixed by _2 at first for the duplicated list and then will be modifiable by your care in Pogues;
-Loops: in the case of a loop that does not rely on a dynamic array or another loop, it will now be possible to indicate in the GUI the minimum number of loop occurrences displayed by default (until now it was always 1 and the user only indicated the maximum number of loop occurrences) ;
-It is now possible to merge two questionnaires by clicking from the initial questionnaire on the +Questionnaire button (at the bottom of the GUI and to the right of Visualize). You can then choose among the questionnaires you own, the one you wish to add to it. Warning: make sure you define the same collection modes for the initial questionnaire and the questionnaire to be added to it! If some elements (sequences, sub-sequences, questions, variables, loops, code list) share the same identifier, the identifier of the second occurrence will be suffixed by _2 ;
-The default size of text responses has been changed from 255 characters (long field) to 249: this choice is more consistent with the transformations performed by Eno (limit of passage between a long field and a short field on the paper for example);
-The filter identifiers have been removed, as they have no use of their own;
-An error message will indicate, if necessary, all the redirections in error (cf. redirection target modified or deleted after having specified the redirection);
-The text alternatives for the paper mode to the redirections or filters referencing external, calculated or collected variables will now be correctly personalised on the pdf;
-Bugs on calculated variables with a dynamic table scope have been fixed.
Sincerely yours,
The Pogues team
01/03/21
Dear Pogues users,
The new version of Pogues in production contains the following enhancements:

It is now possible to duplicate a questionnaire you own via a Duplicate button accessible from the home page listing all your questionnaires;

the "Collected" boolean, accessible for variables collected within a table, and allowing you to indicate that a table cell will not be collected, is now accessible for variables collected within multiple choice questions;

the "End if" of a filter, recalling the last element composing a filter, is now systematically displayed even when the filter is composed of a single element;

The front office has been refactoring so that the set of questionnaires owned by the user when accessing the Pogues home page is no longer loaded into the store as it is today, but only the metadata of the questionnaires on the home page. The loading of a questionnaire in the store is now done when the user explicitly accesses the questionnaire;

Matching of scope and IterableReference of loops when the "Based on" field (optional) of a loop is modified.


See you soon,
The Pogues team

guide-developpeur/remote-apis/implementa.body:
Implémentation
Les requêtes sont déclenchées par les composants React qui requièrent des ressources distantes. Ces composants utilisent les fonctions du type loadSomethingIfNeeded au sein de hooks useEffect() React. Par exemple, le composant PageQuestionnaire appelle loadCampaignsIfNeeded lorsqu'il est instancié. Ce chapitre décrit comment ce processus fonctionne.
Appels distants
Les appels sont définis dans le fichier src/utils/remote-api.js. Ils s'appuient sur l'API fetch. Un polyfill est utilisé pour les navigateurs qui ne supportent pas cette API, grâce à babel-polyfill.
Exemple:
/**
 * Récupérer un questionnaire
 * chemin du type '/pogues/questionnaire/{id}'
 */
export const getQuestionnaire = async (id, token) => {
  const b = await getBaseURI();
  return fetch(`${b}/${pathQuestionnaire}/${id}`, {
    headers: getHeaders({ Accept: 'application/json' }, token),
  }).then(res => res.json());
};

Ce module exporte des fonctions qui retournent une Promesse. Si la requête est réussie, la Promesse sera tenue avec comme valeur:

les données brutes attendues (res.JSON()) pour les requêtes de type GET;
la réponse HTTP brute s'il n'y a pas de donnée à extraire de la réponse;
la valeur d'un champ des headers si opportun.

Ce fichier comporte les appels pour les 3 services utilisés par Pogues:

visualisation (visualizeDDI,visualizePdf,...);
persistance (getQuestionnaire, putQuestionnaire, getQuestionnaireList...);

Créateurs d'actions
Pour déclencher un appel distant, nous utilisons les créateurs d'actions avec le middleware Redux Thunk. On applique le shéma pour les appels asynchrones décrits dans la documentation de Redux.
Grâce à Redux Thunk, les créateurs d'actions peuvent retourner une fonction au lieu d'un objet JavaScript. Ainsi, on peut écrire des actions asyncrhones avec une fonction qui:

envoie immédiatement au store une action sous la forme d'un objet JavaScript, pour indiquer que la requête a bien été enregistrée; le type d'action prend la forme LOAD_SOMETHING;
envoie la requête (grâce aux utilitaires mentionnés plus haut, par exemple la fonction getQuestionnaire);
envoie au store de façon différée une action de la forme LOAD_SOMTHING_SUCCESS si la Promesse renvoyée par fetch a été résolue (le gestionnaire then défini dans la Promesse), ou une action de la forme LOAD_QUESTIONNAIRE_FAILURE si elle échoue (gestionnaire catch);
retourne la Promesse pour d'éventuelles valorisations ultérieures.

Exemple à partir du fichier src/actions/questionnaire.js (dans le code initial, nous utilisons des fonctions flêchées à la place des fonctions classiques):
import { getQuestionnaire } from '(...)/remote-api';

export const loadQuestionnaire = (id, token) => dispatch => {
  dispatch(loadQuestionnaireStart());
  dispatch({
    type: LOAD_QUESTIONNAIRE,
    payload: id,
  });
  return getQuestionnaire(id, token)
    .then(qr => {
      dispatch(loadQuestionnaireSuccess(questionnaireRemoteToStores(qr)));
    })
    .catch(err => {
      dispatch(loadQuestionnaireFailure(id, err));
    });
};

export const loadQuestionnaireStart = () => ({
  type: LOAD_QUESTIONNAIRE_START,
  payload: {},
});

export const loadQuestionnaireSuccess = update => ({
  type: LOAD_QUESTIONNAIRE_SUCCESS,
  payload: {
    update,
  },
});

export const loadQuestionnaireFailure = (id, err) => ({
  type: LOAD_QUESTIONNAIRE_FAILURE,
  payload: { id, err },
});

Remarque: on devrait vraisemblablement éviter l'usage de catch ici (cf. #146)
TODO screenshot devtools
Ne pas récupérer deux fois la même ressource
Nous utilisons également Redux Thunk pour définir des créateurs d'actions qui veilleront à ne pas effectuer un appel distant pour ressource qui aurait déjà été récupérée, et qui serait donc disponible localement dans l'état de l'application.
export const loadUnitsIfNeeded = token => (dispatch, getState) => {
  const state = getState();
  const { units } = state.metadataByType;
  if (!units) dispatch(loadUnits(token));
};

Les créateurs d'actions du type loadSomethingIfNeeded sont appelés à partir des hooks useEffect() des composants React qui ont besoin de la ressource Something.
Exemple issu du fichier src/layout/page-questionnaire/components/page-questionnaire.jsx:
const PageQuestionnaire = props => {

  ...

  useEffect(() => {
    if (
      activeQuestionnaire &&
      !isEqual(activeQuestionnaire, activeQuestionnaireState)
    ) {
      if (activeQuestionnaire.campaigns) {
        const idCampaign =
          activeQuestionnaire.campaigns[
            activeQuestionnaire.campaigns.length - 1
          ];
        loadStatisticalContext(idCampaign, token);
      }
      if (activeQuestionnaire.operation) {
        loadCampaignsIfNeeded(activeQuestionnaire.operation, token);
      }
      setActiveQuestionnaireState(activeQuestionnaire);
    }
  }, [
    token,
    activeQuestionnaire,
    activeQuestionnaireState,
    loadStatisticalContext,
    loadCampaignsIfNeeded,
  ]);

  ...

}

guide-developpeur/remote-apis/fake-serve.body:
Serveur mocké
Un serveur mocké est fourni et repose sur restify
Ce serveur peut être lancé avec la commande yarn dev:server. Il permet de travailler sur le front sans avoir un back qui tourne par ailleurs.
Le serveur contient des fichiers de données et un fichier server.js.
Fichier de données
Un exemple de fichier de données :
module.exports = [
  {
    id: 'DR59-SNDI',
    label: 'DR59-SNDI',
  },
  {
    id: 'DG75-L201',
    label: 'DG75-L201',
  },
];

Ces fichiers de données sont utilisés pour construire les endpoints dans le fichier server.js
Fichier server.js
Dans le fichier server.js, on crée un nouveau server à l'aide de la commande :
const server = restify.createServer();

On configure ensuite ce server et on peut créer des endpoints de la manière suivante :
server.get('/persistence/questionnaire/:id', function (req, res, next) {
  var position = getQuestionnairePosition(questionnaires, req.params.id);
  var questionnaire = position !== -1 ? questionnaires[position] : {};
  res.send(questionnaire);
  next();
});

Exemple de création d'une méthode GET renvoyant un questionnaire à l'aide d'un id.
Ce serveur est à mettre à jour lors de la modification des endpoints côté Back-Office pour assurer son bon fonctionnement et sa compatibilité avec la dernière version du Front.

