Store
Dans ce répertoire se situe le fichier configure-store.js utilisé dans le fichier principal de l'application, afin de configurer le store de l'application .
Utils
Sont définis dans ce répertoire des modules utilitaires nécessaire pour l'ensemble de l'application. Nous essayons de découper ce répertoire en sous-répertoire afin de mieux structurer l'application. Le nom du répertoire correspondra à la partie de l'application utilisant ce module utilitaire. Nous avons par exemple :

component : utilisé par des composants React
dictionary : utilisé pour l'Internationalisation
reducer : utilisé par les reducers
test : utilisé pour les tests unitaires
validation : utilisé pour la validation d'un formulaire avant soumission

Widgets
Dans ce dossier, on va définir les composants réutilisables à différents endroits de l'application. La structure à l'intérieur du dossier est la même que dans le répertoire layout.

guide-developpeur/application/more-on-re.body:
Informations complémentaires sur les reducers et les actions
Traiter des actions
Au départ, les reducers au sein de Pogues étaient écrits avec des instructions switch:
function myReducer(state, action) {
  switch (action.type) {
    case SOMETHING:
      return {...}
    case ANOTHER:
      return {...}
    default:
      return state
  }
}

Cette implémentation ne s'est pas toujours révélée très lisible (dans certaines situations, chaque clause comporte des traitements de plusieurs lignes qui pourraient justifier d'être regroupés sous forme de fonction). Ainsi, une approche s'appuyant sur un dictionnaire de fonctions a été privilégiée. Chaque entrée représente un type d'actions, chaque valeur, une fonction à appeler lorsqu'une action du type correspodant est à traiter. Cette fonction:

prend en premier argument l'état géré par le reducer (par exemple, les codes pour le reducer codes-by-id);
prend le contenu de l'action en deuxième argument;
renvoie un nouvel état.

Extrait du reducer code-by-id:
//un dictionnaire avec tous les types d'actions qui sont à traiter par ce
//reducer, avec pour chaque type, la fonction à utiliser
const actionsHndlrs = {
  CREATE_CODE: createCode,
  REMOVE_CODE: removeCode,
  EDIT_CODE: editCode,
  ...
}

//fonction générique qui remplace l'instruction `switch`
export default function (state={}, action) {
  if (!action) return state
  const { type, payload } = action
  const hndlr = actionsHndlrs[type]
  return hndlr ? hndlr(state, payload, action) : state
}

//la fonction pour traiter les actions `CREATE_CODE`
function createCode(codes, { id, label, value }) {
  return {
    //crée une nouvelle copie de l'état
    ...codes,
    //ajoute une entrée
    [id]: {
      id, label, value
    }
  }
}

...

La fonction générique pourrait utilement être partagée par les différents reducers (au lieu d'être définie au sein de chaque reducer).
Les reducers gèrent des collections
La plupart des reducers gèrent une partie de l'état qui consiste en une collection d'entités. Par exemple, le reducer codes-by-id gère une collection (un objet JavaScript litéral) où chaque clé représente l'identifiant d'un code, et chaque valeur l'information qui constitue le code en question.
Les différents schémas décrits ci-dessous sont assez généraux. La possiblité de développer des utilitaires pour reduire la quantité de code à écrire mériterait d'être étudiée.
Ajouter une entrée:
function createCode(codes, { id, label, value }) {
  return {
    ...codes,
    [id]: {
      id, label, value
    }
  }
}

Supprimer une entrée existante:
function removeCode(codes, { id }) {
  //L'opérateur ... permet de séparer facilement l'entrée à supprimer des
  //autres entrées
  const { [id]: toRemove, ...toKeep } = codes
  return toKeep
}

Mettre à jour une entrée:
function editCode(codes, { id, update }) {
  return {
    //copie de l'état
    ...codes,
    //on écrase l'entrée considérée
    [id]: {
      //copie des valeurs initiales
      ...codes[id],
      //applique le "patch" (toutes les clés contenues par l'action et déjà
      //existantes seront écrasées)
      ...update
    }
  }
}

Contrôles d'intégrité
Le reducer de plus haut niveau pour l'application est construit dynamiquement pour traiter les contrôles d'intégrité sur le questionnaire..

guide-developpeur/javascript/syntax.html.body:
JavaScript
Ce fichier ne fournit pas une présentation exhaustive du langage Javascript. Il cherche à fournir une information minimale et des références externes pour aiguiller le développeur qui ne serait pas familier des fonctionnalités utiliséesdans l'application.
ES2015
Nous utilisons la syntaxe ES2015 grâce au plugin Babel pour Webpack.
Décomposition
L'assignation par décomposition permet d'extraire de l'information d'un tableau ou d'un objet. Elle prend la forme suivante:
const person = { firstname: 'john', lastname: 'doe' };
const { firstname, lastname } = person;
console.log(firstname); // 'john'
console.log(lastname); // 'doe'

Cette syntaxe peut être utilisée pour décomposer les arguements d'une fonction. Elle est utilisée fréquemment lors de la définition de composants React:
function CodeEditor(props) {
  let label = props.label
  (...)
}

peut être ré-écrit:
function CodeEditor({ label }) {
  return (...)
}

L'assignation par décomposition est également souvent utilisée en association avec les fonctions de manipulation de tableaux:
var codes = [{ id: '...', label: '...'}, { id: '...', label: '...' }]
codes.map(function (code) {
  const id = code.id
  const label = code.label
  return ... //faire quelque chose avec id et label
  }
)
}

peut être ré-écrit:
var codes = [{ id: '...', label: '...'}, { id: '...', label: '...' }]
codes.map(({id, label}) => ) {
  return ... //faire quelque chose avec id et label
  }
)
}

Opérateur spread avec les tableaux
Il est utile pour mettre à jour un tableau sans modifier l'objet initial
const initialArray = ['john', 'jack', 'bob'];

//conserver tous les éléments sauf le premier
const [dontCare, ...withoutFirst] = initialArray;

//ajouter une entrée
const withOneMore = [...initialArray, 'kate'];

Opérateur spread avec les objets
Cette syntaxe ne fait pas partie d'ES2015, pourrait être intégrée à de futures versions de JavaScript. Comme ES2015, cette syntaxe est supportée grâche à Babel, avec le plugin transform-object-rest-spread.
Elle permet de faire facilement une copie d'un objet avec de mettre à jour une entrée:
const initialObject = {
  id1: 'one',
  id2: 'two',
  id3: 'three',
};

//`initialObject` ne sera pas modifié
const newObject = {
  ...initialObject,
  id2: 'deux',
};
//une autre approche possible
// const newObject = Object.assign(initialObject, { id2: 'deux' })

On peut également utilsier cet opérateur pour conserver toutes les entrées sauf une (pratique pour supprimer une entrée d'un objet):
const initialObject = {
  john: 25,
  jack: 65,
  bob: 35,
};

//on souhaite supprimer l'entrée "jack"
const { jack: dontCare, ...withoutJack } = initialObject;

//`withoutJack` est le nouvel objet

Propriétés dynamiques
Habituellement, pour créer un objet dont l'une des clés est définie grâce à une variable, on écrit ce type de code:
const firstname = 'john';
const names = {};
names[firstname] = 'doe';

Avec ES2015, les propriétés dynamiques permettent d'écrire:
const firstname = 'john';
const names = {
  [firstname]: 'doe',
};

Cela est en particulier utile en association avec l'opérateur spread pour travailler avec des objets sans modifier leur version initiale (par exemple dasn un reducer). De cette manière, on peut effectuer une copie de l'objet et ne mettre à jour qu'un seul champ:
const initialObject = {
  id1: 'one',
  id2: 'two',
  id3: 'three',
};
const idToProcess = 'id2';
const newValue = 'deux';
const newObject = {
  ...initialObject,
  [idToProcess]: newValue,
};

Raccourci pour l'affectation de propriétés
ES2015 propose un raccourci pour créer un objet à partir de variables lorque les clés de l'objet correspondent aux noms des variables:
var firstname = 'john';
var lastname = 'doe';
//Avant ES2015
var person = {
  firstname: firstname,
  lastname: lastname,
};
//Avec ES2015
var person = {
  firstname,
  lastname,
};

Fonctions flêchées
Les fonctions flêchées sont un moyen concis et pratique pour écrire de petites fonctions anonymes. Elles prennent la forme suivante:
const increment = a => a + 1;

Elles sont utilisées fréquemment dans cette application, mais les déclarations de fonctions classiques sous la forme function () {} doivent être privilégies lorsque la logique n'est pas triviale.
Litéraux de gabarits
Les litéraux de gabarit permettent de décrire facilement des chaînes de caractères qui nécessiteraient sinon la concaténation (+) de plusieurs chaînes. Par exemple, dans le fichier src/js/utils/state-to-model-questionnaire.js:
const makePageBreakGroup = index => ({
  name: `PAGE_${index}`,
  label: `Components for page ${index}`,
  ...
})

Un autre avantage des litéraux de gabarit est qu'ils permettent d'écrire facilement des chaînes de caractères sur plusieurs lignes.
Export et import
L'application utilise des déclarations export and import d'ES2015. En savoir plus au sujet de l'Error: file not found: /github/workspace/local_source/fr/guide-developpeur/javascript/https:/developer.mozilla.org/en/docs/Web/JavaScript/Reference/Statements/import ou de l'export.
De façon simplifiée, on peut retenir qu'il y a deux types d'exports: les exports nommés et les exports par défaut. Les deux sont utilisés dans l'application.
Les exports nommés prennent l'une des formes suivantes:
export const firstNameExport = ...
//ou
export {
  secondNamedExport,
  thirdNamedExport
}

Alors que les exports par défaut sont décrits de la façon suivante:
const mainPurposeOfThisFile = ...
export default mainPurposeOfThisFile

Pour importer un élément qui a été exporté avec un export nommé, on utilise des accolades pour identifier quelle variable exportée doit être importée.
import { firstNameExport, secondNamedExport } from '...';

Pour importer un export par défaut:
import mainPurposeOfThisFile from '...';

Lorsqu'on importe une variable qui a été exportée par défaut, le nom donné à cette variable importée ne doit pas nécessairement correspondre au nom qui a été défini dans le module. Le code précédent peut être ré-récrit sans conséquence de la façon suivante:
//on utilise `aRelevantName` au lieu de `mainPurposeOfThisFile`
import aRelevantName from '...';

Composants
Chaque composant est défni dans son propre fichier. Nous utilisons donc les exports par défaut (pas d'ambiguité sur ce qui est exporté). Il peut y avoir dans un même fichier le composant "visuel" (cf. presentational component), et un composant "connecté". La plupart du temps, seul le composant connecté est utilisé en dehors du module, et l'export prend la forme suivante (cf. src/js/components/component-editor.js):
function ComponentEditor(...) {
}
...
export default connect(mapStateToProps, mapDispatchToProps)(ComponentEditor)

Importer du css
Cette application utilise style-loader avec Webpack. Cela permet d'importer des fichiers css à partir de JavaScript. Ainsi, dans le fichier src/js/main.js, on importe la feuille de style principale de l'applcation de la façon suivante:
require('../css/pogues.css');

Cette approche est pratique:

pour indiquer qu'une feuille de style est nécessaire afin que du code JavaScript produise le résultat attendu;
pour optimiser le chargement du fichier (inclure le css en ligne dans une balise ) et garantir la compatibilité entre navigateurs (par exemple en ajoutant les préfixes nécessaires);
pour permettre à Webpack de prendre en charge la copie de ce fichier dans le dossier dist.
